import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {Component} from 'react';
import {cardList} from './card-list/card-list.component';

class App extends Component{
    constructor(){
        super();
        this.state = {
            // String: 'Hello Uuma'
            monsters: [
                {
                    name: 'Umma'
                },
                {
                    name: 'Dracula'
                },
                {
                    name: 'John'
                },
                {
                    name: 'Zombie'
                }
            ]
        }
    }
    render(){
        return ( 
            <div className="App">
                <cardList name="">{this.state.monsters.map(monster => (<h2>{monster.name}</h2>))}</cardList>
            </div>
        );
    }
}

export default App;
